"""
给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。

示例 1:

输入: "abcabcbb"
输出: 3
解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。
"""


class Solution(object):

    @staticmethod
    def has_repeat_char(string):
        """ 检查字符串是否包含重复字符

        :param string: 原始字符串
        """
        checked_dict = dict()

        for char in string:
            if checked_dict.get(char):
                return True
            checked_dict[char] = 1

        return False

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        max_len = len(s)

        # 忽略单个字符
        if max_len < 2:
            return max_len

        for idx in range(max_len, 1, -1):
            for start in range(0, max_len - idx + 1):
                if not self.has_repeat_char(s[start: start + idx]):
                    return idx

        return 1


